import React from "react";
import "./style.css";
import { ParallaxLayer } from "@react-spring/parallax";

export default function HeaderMenu() {

    return (
      <ParallaxLayer>
        <div className="header-menu">
          <p>Home</p>
          <p>About</p>
          <p>Works</p>
        </div>
      </ParallaxLayer>
    );
}
